import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';
import { useDispatch } from 'react-redux';
import { getAllStudents } from '../../action/student/studentAction'
import { LoadAllAdminData } from './LoadAllDataAdmin';


import React, { Component } from 'react';

class AdminPage extends Component {
    constructor() {
        super()
        this.state({
            user: {},
            message: "Error"
        })
    }
    componentDidMount() {
        const id = sessionStorage.getItem("user");
        axios.get("http://localhost:8080/admin/find/" + id).then(response => {
            this.setState({
                user: response.data
            })
        })
    }

    render() {
        return (
            <div className="">
                <LoadAllAdminData />
                <Header
                    type="ADMIN"
                    user={user} />
                {user ? <UserHomeLayout user={this.state.user} type="ADMIN" /> : <h3>{this.state.message}</h3>}
            </div>
        );
    }
}

export default AdminPage;
